  });

  // World rectangle
   // World coordinates (outer ring)
    const worldRing = [[-180, -90], [180, -90], [180, 90], [-180, 90], [-180, -90]];
    
    // Get Croatia coordinates (inner ring/hole)
    // For MultiPolygon, we need to take all the rings
    const croatiaRings = croatiaGeoJSON.features[0].geometry.coordinates;
    
    // Create a mask with Croatia as a hole
    const mask = {
        type: "FeatureCollection",
        features: [{
            type: "Feature",
            properties: {},
            geometry: {
                type: "Polygon",
                coordinates: [worldRing, ...croatiaRings.flat()]
            }
        }]
    };
    
    map.addSource('mask', { 
        type: 'geojson', 
        data: mask 
    });

    // Add the mask layer
    map.addLayer({
        id: 'outside-mask',
        type: 'fill',
        source: 'mask',
        paint: { 
            'fill-color': '#fff', 
            'fill-opacity': 1 
        }
    });

    // Add Croatia outline
    map.addLayer({
        id: 'croatia-outline',
        type: 'line',
        source: 'croatia',
        paint: { 
            'line-color': 'red', 
            'line-width': 3, 
            'line-opacity': 1 
        }
    });

    // Create a clipping mask using CSS
    const mapContainer = document.getElementById('map');
    mapContainer.style.clipPath = `path('${croatiaToSVGPath()}')`;
